 ],\n    \"metadata\": {\n      \"version\": \"2.0\"\n    },\n    \"order\": 1\n  },\n  {\n    \"id\": \"open-api\",\n    \"uri\": \"https://127.0.0.1:5555\",\n    \"predicates\": [\n      {\n        \"name\": \"Path\",\n        \"args\": {\n          \"pattern\": \"/v3/api-docs/**\"\n        }\n      },\n      {\n        \"name\": \"Weight\",\n        \"args\": {\n          \"_genkey_0\": \"open-api\",\n          \"_genkey_1\": \"100\"\n        }\n      }\n    ],\n    \"filters\": [\n      {\n        \"name\": \"RewritePath\",\n        \"args\": {\n          \"_genkey_0\": \"/v3/api-docs/(?<path>.*)\",\n          \"_genkey_1\": \"/$\\\\{path}/v3/api-docs\"\n        }\n      }\n    ],\n    \"metadata\": {},\n    \"order\": 1\n  },\n  {\n    \"id\": \"laokou-im\",\n    \"uri\": \"lb:wss://laokou-im\",\n    \"predicates\": [\n      {\n        \"name\": \"Path\",\n        \"args\": {\n          \"pattern\": \"/im/**\"\n        }\n      },\n      {\n        \"name\": \"Weight\",\n        \"args\": {\n          \"_genkey_0\": \"im\",\n          \"_genkey_1\": \"100\"\n        }\n      }\n    ],\n    \"filters\": [\n      {\n        \"name\": \"StripPrefix\",\n        \"args\": {\n          \"parts\": \"1\"\n        }\n      },\n      {\n        \"name\": \"RewritePath\",\n        \"args\": {\n          \"_genkey_0\": \"/im/(?<path>.*)\",\n          \"_genkey_1\": \"/$\\\\{path}\"\n        }\n      },\n      {\n        \"name\": \"IpWhite\",\n        \"args\": {\n          \"sources\": \"127.0.0.1,192.168.30.1\"\n        }\n      }\n    ],\n    \"metadata\": {\n      \"version\": \"2.0\"\n    },\n    \"order\": 1\n  }\n]', '343140c6dd5eb79105de716d40cc6800', '2023-01-13 15:44:25', '2023-11-09 08:51:22', 'nacos', '0:0:0:0:0:0:0:1', 'laokou-gateway', 'a61abd4c-ef96-42a5-99a1-616adee531f3', '动态路由配置', '', '', 'json', '', '');
