INSERT INTO `his_config_info` VALUES (2159, 3038, 'application-common-kafka.yaml', 'LAOKOU_GROUP', '', '1spring:\n  kafka:\n    bootstrap-servers: 192.168.62.137:9092\n    producer:\n      # 发生错误后，消息重发的次数。\n      retries: 5\n      #当有多个消息需要被发送到同一个分区时，生产者会把它们放在同一个批次里。该参数指定了一个批次可以使用的内存大小，按照字节数计算。\n      batch-size: 16384\n      # 设置生产者内存缓冲区的大小。\n      buffer-memory: 33554432\n      # 键的序列化方式\n      key-serializer: org.apache.kafka.common.serialization.StringSerializer\n      # 值的序列化方式\n      value-serializer: org.apache.kafka.common.serialization.StringSerializer\n      # acks=0 ： 生产者在成功写入消息之前不会等待任何来自服务器的响应。\n      # acks=1 ： 只要集群的首领节点收到消息，生产者就会收到一个来自服务器成功响应。\n      # acks=all ：只有当所有参与复制的节点全部收到消息时，生产者才会收到一个来自服务器的成功响应。\n      acks: 0\n    listener:\n      # 在侦听器容器中运行的线程数。\n      concurrency: 5\n      #listner负责ack，每调用一次，就立即commit\n      ack-mode: manual\n      missing-topics-fatal: false', '71cccf23daa06b3b766a1ed3379ef6ed', '2023-10-26 01:04:52', '2023-10-26 08:55:35', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'a61abd4c-ef96-42a5-99a1-616adee531f3', '');
