INSERT INTO `his_config_info` VALUES (2159, 3070, 'application-common-kafka.yaml', 'LAOKOU_GROUP', '', 'spring:\n  kafka:\n    bootstrap-servers: 127.0.0.1:9092\n    consumer:\n      # 禁用自动提交（按周期）已消费offset\n      enable-auto-commit: false\n      # 单次poll()调用返回的记录数\n      max-poll-records: 50\n      key-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n      value-deserializer: org.apache.kafka.common.serialization.StringDeserializer\n    producer:\n      # 发生错误后，消息重发的次数。\n      retries: 5\n      #当有多个消息需要被发送到同一个分区时，生产者会把它们放在同一个批次里。该参数指定了一个批次可以使用的内存大小，按照字节数计算。\n      batch-size: 16384\n      # 设置生产者内存缓冲区的大小。\n      buffer-memory: 33554432\n      # 键的序列化方式\n      key-serializer: org.apache.kafka.common.serialization.StringSerializer\n      # 值的序列化方式\n      value-serializer: org.apache.kafka.common.serialization.StringSerializer\n      # acks=0 ： 生产者在成功写入消息之前不会等待任何来自服务器的响应。\n      # acks=1 ： 只要集群的首领节点收到消息，生产者就会收到一个来自服务器成功响应。\n      # acks=all ：只有当所有参与复制的节点全部收到消息时，生产者才会收到一个来自服务器的成功响应。\n      acks: 0\n    listener:\n      # 在侦听器容器中运行的线程数。\n      concurrency: 5\n      # listner负责ack，每调用一次，就立即commit\n      ack-mode: manual\n      # 批量batch类型\n      type: batch\n      # topic不存在报错\n      missing-topics-fatal: false', 'ea360f732b997bf3aa89abd59185dfbf', '2023-11-05 17:56:05', '2023-11-06 18:14:00', 'nacos', '0:0:0:0:0:0:0:1', 'U', 'a61abd4c-ef96-42a5-99a1-616adee531f3', '');
